import { TextField } from '@mui/material';
import React from 'react';
import { useForm } from 'react-hook-form';
import * as yup from 'yup';

const Form = () => {
  return (
    <form>
      <TextField
        label="Title"
        variant="outlined"
        fullWidth
        margin="normal"
        required
      />
      <TextField
        label="Description"
        variant="outlined"
        fullWidth
        margin="normal"
        required
      />
    </form>
  );
};

export default Form;
